import React from "react";
import { useStateContext } from "../context/StateContext";

export default function NormalizedTableView() {
  const { selectedTable, tableData } = useStateContext();

  if (!selectedTable) return <p>Select a normalized table to view</p>;
  if (tableData.length === 0) return <p>Loading table data...</p>;

  const headers = Object.keys(tableData[0] || {});

  return (
    <div
      style={{
        border: "1px solid #ccc",
        padding: 10,
        maxHeight: 300,
        overflow: "auto",
        marginBottom: 10,
      }}
    >
      <h3>Table View: {selectedTable}</h3>
      <table style={{ borderCollapse: "collapse", width: "100%" }}>
        <thead>
          <tr>
            {headers.map((h) => (
              <th
                key={h}
                style={{ border: "1px solid #ccc", padding: 5, backgroundColor: "#ddd" }}
              >
                {h}
              </th>
            ))}
          </tr>
        </thead>
        <tbody>
          {tableData.map((row, i) => (
            <tr key={i}>
              {headers.map((h) => (
                <td key={h} style={{ border: "1px solid #ccc", padding: 5 }}>
                  {row[h]}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
